    "evaluating-food-use-by-anatidae-while-using-rainwater-basin-waterfowl-production-areas",nt"isopen":
    false,nt"url": null,nt"notes": "Status and final report of the study to
    describe wetland food use (i.e. diet) by northern pintail (Anas acuta), green-winged
    teal (Anas crecca, GWT) and mallard (Anas platyrhynchos) on Rainwater Basin (RWB)
    Waterfowl Production Areas (WPAs) at peak abundance during spring migration. Understanding
    food habits by these selected species will help determine if niche partitioning
    is occurring, which may redirect management efforts in such a way that will support
    fat acquisition for these species. This work may also support regional and national
    conservation efforts by providing data that will be incorporated in a bioenergetic
    assessment for monitoring the RWB WMDu2019s wetlands.",nt"license_title": "License
